ingredients_text:
Brot: Weizenmehl, Wasser, Hefe, Salz, Roggenmehl, Weizenmalzmehl, Weizengluten; 

Mediterrane Kräuter-Crème 20%: Rapsöl, Wasser, Knoblauch, natives Olivenöl 10%, Kräuter (Basilikum, Oregano, Thymian, Rosmarin), Salz, Stärke, modifizierte Stärke, Zitronensaftkonzentrat, natürliches Kräuteraroma. 

Das Produkt kann Spuren von Milch und Sesam enthalten.
